import React, {Component, useEffect} from "react";
import './Navbar.css'
import { useNavigate } from "react-router-dom";

function Navbar(){

    const navigate = useNavigate();
    
    function handleClickAbout() {
        navigate("/About")
    }
    function handleClickServices() {
        navigate("/Services")
    }
    function handleClickContact() {
        navigate("/Contact")
    }
    function handleClickSkillset_page() {
        navigate("/Skillset_page")
    }
        return (
            <div className="main">
            <nav className="nav">
                <h3 className="heading">MyPortfolio</h3>
                <ul> 
                    <li>
                         <a className="about-btn" onClick={handleClickAbout}><b>About Me </b></a>
                    </li>
                    <li>
                        <a onClick={handleClickServices}><b>Services</b></a>
                        </li>
                    <li>
                        <a onClick={() => {useEffect(() => {
    window.location.href = "https://google.com/contact";
  }, []);}}><b>Portfolio</b></a>
                    </li>

                    <li>
                        <a onClick={handleClickSkillset_page}><b>Skillset</b></a>
                    </li>

                    <li>
                        <a onClick={handleClickContact}><b>Contact Me</b></a>
                    </li>
                </ul>
                <h4 className="resume-btn">MyResume</h4>
            </nav>
            </div>
        );
    }
export default Navbar;
